(750, 1, 'Комбо 10+7', '&lt;p&gt;Комбо для большого корпоратива!&lt;/p&gt;&lt;p&gt;10 пицц 36 см. и 7 напитков 1 л. на выбор.&amp;nbsp;&lt;/p&gt;', '', '', 'Комбо 10+7', '', ''),
(751, 1, 'Комбо 3+2', '&lt;p&gt;Комбо для корпоратива!&lt;/p&gt;&lt;p&gt;3 пиццы 36 см. и 2 напитка 1 л. на выбор.&amp;nbsp;&lt;/p&gt;', '', '', 'Комбо 3+2', '', ''),
(752, 1, 'Комбо 5+3', '&lt;p&gt;Комбо для корпоратива!&lt;/p&gt;&lt;p&gt;5 пицц 36 см. и 3 напитка 1 л. на выбор.&amp;nbsp;&lt;/p&gt;', '', '', 'Комбо 5+3', '', ''),
(753, 1, 'Комбо 7+5', '&lt;p&gt;Комбо для веселого корпоратива!&lt;/p&gt;&lt;p&gt;7 пицц 36 см. и 5 напитков 1 л. на выбор.&amp;nbsp;&lt;/p&gt;', '', '', 'Комбо 7+5', '', ''),
(759, 1, 'Мастер класс', '', '', '', 'Мастер класс', '', ''),
(760, 1, 'Пицца Новогодняя', '&lt;p&gt;Пицца-соус, сыр моцарелла, говядина копченая, соус брусничный, брусника, руккола&lt;br&gt;&lt;/p&gt;', '', '', 'Пицца Новогодняя 26 см', '', ''),
(761, 1, 'Пицца Новогодняя 31 см', '&lt;p&gt;Пицца-соус, сыр моцарелла, говядина копченая, соус брусничный, брусника, руккола&lt;br&gt;&lt;/p&gt;', '', '', 'Пицца Новогодняя 31 см', '', ''),
(762, 1, 'Пицца Новогодняя 36 см', '&lt;p&gt;Пицца-соус, сыр моцарелла, говядина копченая, соус брусничный, брусника, руккола&lt;br&gt;&lt;/p&gt;', '', '', 'Пицца Новогодняя 36 см', '', ''),
(763, 1, 'Крем-суп тыквенно-сырный', '&lt;p&gt;&lt;span style=&quot;color: rgb(71, 82, 89); font-family: Roboto, sans-serif;&quot;&gt;Тыква, морковь, лук репчатый, сыр сливочный плавленный, сливки, соль, специи ассорти, перец черный молотый, сухарики&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', '', 'Крем-суп тыквенно-сырный', '', ''),
(764, 1, 'Салат с тунцом', '&lt;p&gt;&lt;span style=&quot;color: rgb(71, 82, 89); font-family: Roboto, sans-serif;&quot;&gt;Салат айсберг, тунец консервированный, красный лук, руккола, помидоры, маслины, масло оливковое, соевый соус, специи ассорти&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', '', 'Салат с тунцом', '', ''),
(765, 1, 'Крылья 5 шт', '&lt;p&gt;&lt;span style=&quot;font-family: &amp;quot;Exo 2&amp;quot;, sans-serif; font-size: 15px;&quot;&gt;куриное крыло, соль, яйцо, мука, перец ч/м, масло подсолнечное, сухари, паприка&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', '', 'Крылья 5 шт', '', ''),
(766, 1, 'Крылья 8 шт', '&lt;p&gt;&lt;span style=&quot;font-family: &amp;quot;Exo 2&amp;quot;, sans-serif; font-size: 15px;&quot;&gt;куриное крыло, соль, яйцо, мука, перец ч/м, масло подсолнечное, сухари, паприка&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', '', 'Крылья 8 шт', '', ''),
(767, 1, 'Острые крылья 5 шт', '&lt;p&gt;&lt;span style=&quot;font-family: &amp;quot;Exo 2&amp;quot;, sans-serif; font-size: 15px;&quot;&gt;куриное крыло, соль, яйцо, мука, перец ч/м, масло подсолнечное, сухари, паприка, соус Red Devil&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', '', 'Острые крылья 5 шт', '', ''),
(768, 1, 'Острые крылья 8 шт', '&lt;p&gt;&lt;span style=&quot;font-family: &amp;quot;Exo 2&amp;quot;, sans-serif; font-size: 15px;&quot;&gt;куриное крыло, соль, яйцо, мука, перец ч/м, масло подсолнечное, сухари, паприка, соус Red Devil&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', '', 'Острые крылья 8 шт', '', ''),
(769, 1, 'Чёкинсы 5 шт', '&lt;p&gt;&lt;span style=&quot;font-family: &amp;quot;Exo 2&amp;quot;, sans-serif; font-size: 15px;&quot;&gt;куриное филе, сухари, яйцо, мука, соль, перец ч/м, масло для фритюра&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', '', 'Чёкинсы 5 шт', '', ''),
